import { Container, FacebookIcon, InstagramIcon, MapsIcon, SocialContainer, WhatsappIcon } from "./styles";


function Footer() {
    const handleFacebookClick = () => {
        const facebookUrl = "https://www.facebook.com/andretamiao.adv/";
        window.open(facebookUrl, "_blank"); // Abre o link em uma nova janela/aba
    };

    return (
        <Container>
            <SocialContainer>
                <FacebookIcon onClick={handleFacebookClick}></FacebookIcon>
                <InstagramIcon></InstagramIcon>
                <WhatsappIcon></WhatsappIcon>
            </SocialContainer>
            <MapsIcon></MapsIcon>
        </Container>
    );
}

export default Footer;
